// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721Receiver.sol";

//falta añadir el tema de royalties

contract MyTokenTemplate is ERC721, Pausable, Ownable {
    using Counters for Counters.Counter;

    Counters.Counter private _tokenIdCounter;

    uint256 public totalSupply;
    uint256 public availableSupply;
    uint256 public price;
    uint256 public percentage;
    string public fixURI;

    constructor(
        string memory _name,
        string memory _symbol,
        string memory _uri,
        uint256 _totalSupply,
        uint256 _price,
        uint256 _percentage
    ) ERC721(_name, _symbol) {
        totalSupply = _totalSupply;
        availableSupply = _totalSupply;
        price = _price;
        fixURI = _uri;
        percentage = _percentage;
    }

    /////////////////////////////////////////////
    // Price functions
    /////////////////////////////////////////////
    function updatePrice(uint256 _price) external onlyOwner {
        price = _price;
    }

    /////////////////////////////////////////////
    // Mint functions
    /////////////////////////////////////////////
    function safeMint(address buyer, uint256 _amount) public {
        for (uint256 i = 0; i < _amount; i++) {
            uint256 tokenId = _tokenIdCounter.current();
            _tokenIdCounter.increment();
            _safeMint(buyer, tokenId);
        }

        availableSupply = availableSupply - _amount;
    }
}

contract MyNFTReceiver is IERC721Receiver {
    event TokenReceived(address operator, address from, uint256 tokenId, bytes data);

    function onERC721Received(
        address operator,
        address from,
        uint256 tokenId,
        bytes calldata data
    ) external override returns (bytes4) {
        emit TokenReceived(operator, from, tokenId, data);
        return this.onERC721Received.selector;
    }
}
